import ReactDOM  from 'react-dom';

const gv = "Good Morning";
let curentTime  = new Date();
curentTime = curentTime.getHours();

ReactDOM.render(
  <h1>{` Hello , ${gv} ${curentTime}`}</h1>,
  document.getElementById("root")
);
